import { connect } from 'react-redux'

let ProductsList = ( props ) => (
    props.product.map((product, index) =>{
        return (
            <div key={`${index}`}>
                {product} />
            </div>
        )
        })

    // return (
    //     <div>
    //         {temp}
    //     </div>
    // )
)

const mapStateToProps = (state) => ({
    product: state.prod
})

export default connect(
    mapStateToProps,
    null
)(ProductsList)
